window.bookSummaryJSON = "<p><b>Abraham never played an away game quite like this.</b></p> <p>Having battled and defeated every adversary in his path, Abraham and the Henchmen’s bond grows stronger when a darker fate intervenes. The King demands satisfaction. The quest to complete the Crown of Stones is far from over. The eager king thrusts another mysterious Henchmen into the group, a wizard with god-like powers, but can he be trusted?</p> <p>As the Henchmen resume their quest to acquire the artifacts that can save the kingdom and send Abraham back home, the enemies gain more modern firepower. Abraham must track down another otherworlder, the horned halfling Big Apple, and find the answers he seeks about the broader conspiracy.</p> <p>With his consciousness drifting between home and Titanuus, he starts to unravel who controls the portals that will lead him back home. That knowledge places his friends in danger and Abraham must learn to fight his enemies in both worlds.</p> <p>Now, the fate of two worlds lies in the hands of a fallen sport hero who must redeem himself and find the way home.</p>"; 
